void LegitAim(struct usercmd_s* cmd)
{
	deque<unsigned int> Hitboxes;
		//Hitboxes.push_back(11);

	for (unsigned int j = 0; j <= 11; j++)
		Hitboxes.push_front(j);

	for (unsigned int k = 12; k < g_Local.iMaxHitboxes; k++)
		Hitboxes.push_back(k);

	if (Hitboxes.empty())
		return;

	unsigned int m_iTarget = 0;
	int m_iHitbox = -1;

	float m_flBestFOV = g_Vars.RageAimFov;
	float m_flBestDist = g_Vars.RageAimDist;

	for (unsigned int id = 1; id <= g_Engine.GetMaxClients(); ++id)
	{
		if (id == g_Local.ent->index)
			continue;

		if (g_LocalPlayer[id].Death)
			continue;
		if (g_Vars.AimTeamselection == 0)
		{
			if (g_LocalPlayer[id].Team == g_Local.Team)
				continue;

		}
		else if (g_Vars.AimTeamselection == 1)
		{
			if (g_LocalPlayer[id].Team != g_Local.Team)
				continue;
		}

		for (auto&& hitbox : Hitboxes)
		{
			//if (g_HitBox[id].bHitboxVisible[hitbox])
			{
				m_iHitbox = hitbox;
				break;
			}
		}

		if (m_iHitbox < 0 || m_iHitbox > g_Local.iMaxHitboxes)
		{
			g_Vars.AimTarget = 0; continue;
		}

		if (!vAimNow)
		{
			if (g_Vars.Rage_Target_Selection == 0)
			{
				if (g_HitBox[id].vOriginFOV < m_flBestFOV && !vAimNow)
				{
					m_flBestFOV = g_HitBox[id].vOriginFOV;
					m_iTarget = id;
					g_Vars.AimTarget = m_iTarget;
				}
			}
			else if (g_Vars.Rage_Target_Selection == 1)
			{
				if (g_LocalPlayer[id].flDist < m_flBestDist && !vAimNow)
				{
					m_flBestDist = g_LocalPlayer[id].flDist;
					m_iTarget = id;
					g_Vars.AimTarget = m_iTarget;
				}
			}
			else if (g_Vars.Rage_Target_Selection == 2 && !vAimNow)
			{
				if (g_HitBox[id].vOriginFOV < m_flBestFOV)
				{
					if (g_LocalPlayer[id].flDist < m_flBestDist)
					{
						m_flBestFOV = g_HitBox[id].vOriginFOV;
						m_flBestDist = g_LocalPlayer[id].flDist;
						m_iTarget = id;
						g_Vars.AimTarget = m_iTarget;
					}
				}
			}
		}
		else
		{
			m_iTarget = g_Vars.AimTarget;
			if (g_LocalPlayer[m_iTarget].Death)
			{
				vAimNow = false;
				continue;
			}
			if (g_Vars.AimTeamselection == 0)
			{
				if (g_LocalPlayer[m_iTarget].Team == g_Local.Team)
					continue;

			}
			else if (g_Vars.AimTeamselection == 1)
			{
				if (g_LocalPlayer[m_iTarget].Team != g_Local.Team)
					continue;
			}
		}
	}
	if (m_iTarget > 0 && g_Vars.AimTarget > 0 && (m_iTarget == g_Vars.AimTarget))
	{
		QAngle QMyAngles, QAimAngles, QSmoothAngles;
		QVector vAimOrigin;
		if (g_LocalPlayer[m_iTarget].isZombie)
		{
			vAimOrigin = g_LocalPlayer[m_iTarget].HeadBone;
			vAimOrigin.z -= 15.5f;
			vAimOrigin.z += g_Vars.AimOffset;
		}
		else
		{
			vAimOrigin = g_HitBox[m_iTarget].vHitbox[m_iHitbox];
			vAimOrigin.z -= 15.5f;
			vAimOrigin.z += g_Vars.AimOffset;
		}
		g_Engine.GetViewAngles(QMyAngles);
		VectorAngles(vAimOrigin - g_Local.vEye, QAimAngles);
		if (g_Vars.NoRecoilAngle)
		{
			QAimAngles -= (g_Local.vPunchangle * g_Vars.NoRecoilValue);
		}

		if (g_Vars.TwoKey)
		{
			if ((keys[1] || keys[2]) && m_iTarget == g_Vars.AimTarget)
			{
				MakeAngle(false, QAimAngles, cmd);
				g_Engine.SetViewAngles(QAimAngles);
				vAimNow = true;
			}
			else
				vAimNow = false;
		}
		else
		{
			if (keys[g_Key.RageAimKey] && m_iTarget == g_Vars.AimTarget)
			{
				MakeAngle(false, QAimAngles, cmd);
				g_Engine.SetViewAngles(QAimAngles);
				vAimNow = true;
			}
			else
				vAimNow = false;
		}

	}
}

